webpackJsonp([0xaad98bd450f2],{3591:function(e,t){e.exports={data:{markdownRemark:{html:'<pre><code class="language-HTML">&#x3C;!DOCTYPE html PUBLIC "-//W3C//DTD HTML 3.2 Final//EN">\n&#x3C;html>\n  &#x3C;head>\n    &#x3C;meta content="text/html; charset=SHIFT_JIS" http-equiv="Content-Type">\n    &#x3C;title>もじもじのホームページ&#x3C;/title>\n  &#x3C;/head>\n  &#x3C;body>\n    &#x3C;p>もじもじ文字&#x3C;/p>\n  &#x3C;/body>\n&#x3C;/html>\n</code></pre>\n<h2>解説</h2>\n<p><code>&#x3C;head></code>という新しいタグが出てきた。ここでページの設定などいじることができる。</p>\n<p><code>&#x3C;meta></code>。\nこれは非常に重要なタグだが、現段階では難しいのでこのままコピーすることをお勧めする。\nもし、これをコピーした結果、文字化けするようなら <code>SHIFT_JIS</code> のところを <code>EUC-JP</code> か <code>iso-2022-jp</code> か、あるいは <code>utf-8</code> かに置き換えると直る。</p>\n<p><code>&#x3C;title></code> で囲んだ部分がそのページのタイトルとなる。\nたとえば上の例では「もじもじのページ」となる。</p>\n<p>あとは前回と同じ。</p>',frontmatter:{cover:null,date:"2001-09-21T15:34:00+09:00",strDate:"2001/9/21",title:"HTML講座2"}}},pathContext:{path:"/ja/blog/2001/09/21-html%e8%ac%9b%e5%ba%a72/",langKey:"ja"}}}});
